import React from "react";

const e = React.createElement;
const consoleStyle = {
  width: "100%",
  height: 510,
  resize: "none",
  outline: "none"
};

class Console extends React.Component {


    getDerivedStateFromProps(props){
        console.log('test',props)
    }


  render() {
    return e("textarea", {
      style: consoleStyle,
      defaultValue: this.props.console
    });
  }
}

export default Console;
